package img

import (
	"os"
	"testing"
)

func TestValidFormat(t *testing.T) {
	testNames := []string{
		"toot.ppp",
		"toot.png",
	}
	wants := []bool{false, true}
	for i, test := range testNames {
		if got := IsValidFormat(test); got != wants[i] {
			t.Errorf("format isn't valid %v\n", got)
		}
	}
}

func TestSaveFormat(t *testing.T) {
	tstImg := `testdata/video-001.png`
	img, err := Open(tstImg)
	if err != nil {
		t.Fatal(err)
	}
	err = GIF.Save(`testdata/format_save`, img)
	if err != nil {
		t.Fatal(err)
	}
}

func TestBase64(t *testing.T) {
	tstImg := `testdata/video-001.png`
	img, err := Open(tstImg)
	if err != nil {
		t.Fatal(err)
	}
	enc := NewEncoder(PNG, Base64(BASE64))
	tstB64File := `testdata/video.b64`
	f, err := os.Create(tstB64File)
	if err != nil {
		t.Fatal(err)
	}
	defer f.Close()
	err = enc.Encode(f, img)
	if err != nil {
		t.Fatal(err)
	}

	data, err := os.ReadFile(tstB64File)
	if err != nil {
		t.Fatal(err)
	}
	got := string(data)
	if want := tstPngImgB64; got != want {
		t.Errorf("base64 image string is not equal")
	}
}

func TestDataURL(t *testing.T) {
	tstImg := `testdata/video-001.png`
	img, err := Open(tstImg)
	if err != nil {
		t.Fatal(err)
	}
	enc := NewEncoder(PNG, Base64(URL))
	tstB64File := `testdata/video.txt`
	f, err := os.Create(tstB64File)
	if err != nil {
		t.Fatal(err)
	}
	defer f.Close()
	err = enc.Encode(f, img)
	if err != nil {
		t.Fatal(err)
	}

	data, err := os.ReadFile(tstB64File)
	if err != nil {
		t.Fatal(err)
	}
	got := string(data)
	want := dataURL(enc.Format, tstPngImgB64, false)
	if got != want {
		t.Errorf("base64 image string is not equal")
	}
}

